query EndsOfBettingPeriod($where: EndOfBettingPeriod_filter) {
  endOfBettingPeriods(where: $where) {
    chainName
    gameId
    drawnNumber
    closer
    reward
    timestamp
    blockNumber
    blockTimestamp
    transactionHash
  }
}

